import React, { Component } from 'react';

import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';

class App extends Component {
  render() {
    return (
      <div className = "App">
        <h1>Hello World</h1>
      </div>
    );
  }
}
export default App;
